import axios from 'axios';

const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:3001/api';

class AuthService {
  constructor() {
    this.token = localStorage.getItem('admin_token');
    this.setupInterceptors();
  }

  setupInterceptors() {
    // Request interceptor
    axios.interceptors.request.use(
      (config) => {
        const token = localStorage.getItem('admin_token');
        if (token) {
          config.headers.Authorization = `Bearer ${token}`;
        }
        console.log('ğŸ“¡ API Request:', {
          url: config.url,
          method: config.method,
          hasAuth: !!token
        });
        return config;
      },
      (error) => {
        console.error('ğŸ“¡ Request interceptor error:', error);
        return Promise.reject(error);
      }
    );

    // Response interceptor
    axios.interceptors.response.use(
      (response) => {
        console.log('ğŸ“¡ API Response:', {
          url: response.config.url,
          status: response.status,
          success: response.data.success
        });
        return response;
      },
      (error) => {
        console.error('ğŸ“¡ API Error:', {
          url: error.config?.url,
          status: error.response?.status,
          message: error.response?.data?.message,
          error: error.response?.data
        });
        
        if (error.response?.status === 401) {
          console.log('ğŸ” Unauthorized - clearing auth data');
          this.logout();
          // Don't redirect here, let the component handle it
        }
        return Promise.reject(error);
      }
    );
  }

  async login(credentials) {
    try {
      console.log('ğŸ” Attempting login:', {
        username: credentials.username,
        passwordLength: credentials.password?.length,
        apiUrl: `${API_BASE_URL}/auth/login`
      });

      const response = await axios.post(`${API_BASE_URL}/auth/login`, {
        username: credentials.username.trim(),
        password: credentials.password
      });
      
      console.log('ğŸ” Login response:', {
        status: response.status,
        success: response.data.success,
        hasToken: !!response.data.data?.token,
        admin: response.data.data?.admin?.Username
      });

      if (response.data.success) {
        const { token, admin } = response.data.data;
        
        // Store token and admin info
        localStorage.setItem('admin_token', token);
        localStorage.setItem('admin_info', JSON.stringify(admin));
        
        this.token = token;
        
        console.log('âœ… Login successful - data stored');
        console.log('ğŸ” Token stored:', token.substring(0, 20) + '...');
        
        return {
          success: true,
          admin: admin,
          token: token
        };
      }
      
      console.log('âŒ Login failed:', response.data.message);
      return {
        success: false,
        message: response.data.message || 'Login failed'
      };
      
    } catch (error) {
      console.error('âŒ Login error:', {
        message: error.message,
        response: error.response?.data,
        status: error.response?.status
      });
      
      return {
        success: false,
        message: error.response?.data?.message || 'Network error. Please try again.'
      };
    }
  }

  async logout() {
    try {
      console.log('ğŸ” Logging out...');
      if (this.token) {
        await axios.post(`${API_BASE_URL}/auth/logout`);
      }
    } catch (error) {
      console.log('ğŸ” Logout API call failed (continuing anyway):', error.message);
    } finally {
      localStorage.removeItem('admin_token');
      localStorage.removeItem('admin_info');
      this.token = null;
      console.log('âœ… Logout complete - data cleared');
    }
  }

  isAuthenticated() {
    const hasToken = !!this.token && !!localStorage.getItem('admin_token');
    console.log('ğŸ” Auth check:', { 
      hasToken, 
      tokenExpired: this.isTokenExpired(),
      tokenExists: !!localStorage.getItem('admin_token')
    });
    return hasToken;
  }

  getToken() {
    return this.token || localStorage.getItem('admin_token');
  }

  getAdminInfo() {
    const adminInfo = localStorage.getItem('admin_info');
    return adminInfo ? JSON.parse(adminInfo) : null;
  }

  // FIXED: More robust token expiry check
  isTokenExpired() {
    const token = this.getToken();
    if (!token) {
      console.log('ğŸ” No token found');
      return true;
    }

    try {
      // Split token and decode payload
      const tokenParts = token.split('.');
      if (tokenParts.length !== 3) {
        console.log('ğŸ” Invalid token format');
        return true;
      }
      
      const payload = JSON.parse(atob(tokenParts[1]));
      const currentTime = Math.floor(Date.now() / 1000);
      const isExpired = payload.exp < currentTime;
      
      console.log('ğŸ” Token expiry check:', { 
        expires: new Date(payload.exp * 1000), 
        now: new Date(), 
        isExpired 
      });
      
      return isExpired;
    } catch (error) {
      console.error('ğŸ” Token parsing error:', error);
      return true;
    }
  }
}

export default new AuthService();
